 {
   render()
     {
       return (
          <div>
               <div className="Nav-bar">

                  
                 <Link to='/homepage'>
                   <li className="Homepage">Homepage</li>
                 </Link>
                 <Link to='/details'>
                   <li>Details Page</li>
                 </Link>
                 
               </div>

          </div>
        );
      }
    }

export default Instruction;
